import Header from './common/header/index';
import { Provider } from 'react-redux';
import { BrowserRouter, Router } from 'react-router-dom';
import store from './store';

function App() {
  return (
    <Provider store={store}>
      <div>
        <Header />
        <BrowserRouter>
          <div>
            <Router path='/' render={() => <home>home</home>}></Router>
            <Router path='/' render={() => <home></home>}></Router>
          </div>
        </BrowserRouter>
      </div>
    </Provider>
  );
}

export default App;
